To allow for the linking of models in RDF the key identifier in and between models need to be represented as IRI s. This section introduces a Simple URN naming scheme for absolute Smithy shape identifiers. While it is clear that a stable, unique identifier should be used in the same way as the Smithy Shape ID, it is not at all clear that this needs to carry any location information with it. It would be preferrable to use the Smithy trait system to associate locations with models rather than forcing location onto all models and model elements. The choice of a URN over URL scheme was therefore easier, and provides a clear, human-readable and easily parsed identifier format. The following rules describe the mapping from Smithy Shape ID to a URN form required by the model and shape mapping. The URI scheme MUST be exactly urn. The URN scheme MUST be exactly smithy. The namespace-specific string (NSS) MUST be formatted as follows. The identifier's namespace component. The colon character, ':'. The identifier's shape name component. If the Shape ID represents a member shape: The forward slash character, '/'. The identifier's member name component. The following demonstrates this mapping visually. example.namespace#shape$member |---------------| |---| |----|
urn:smithy:example.namespace:shape/member The following is a simplified form of the mapping described above. use atelier_core::model::ShapeID; fn simple_shapeid_to_urn(shape_id: &ShapeID) -> String { format!( "urn:smithy:{}:{}{}", shape_id.namespace(), shape_id.shape_name(), if let Some(member_name) = shape_id.member_name() { format!("/{}", member_name) } else { String::new() } )
}

